import React from 'react';

const Button = props => {
  // const buttonClicked = e => {
  //   props.buttonClicked(e.target.value);
  //   props.buttonClicked(console.log('value: ', props.value, 'name: ', props.name));
  // };
  return (
    <button
      value={props.value}
      onClick={this.props.onClick}
      style={props.itemType === 'number' ? styles.number : styles.operator}
    >
      {props.value}
    </button>
  );
};
const styles = {
  number: {
    width: '5vw',
    margin: '0.2vw',
    height: '10vh',
    background: '#D6D6FA',
    display: 'flex',
    alignItems: 'center',
    justifyContent: 'center',
    textAlign: 'center',
    borderRadius: '0.5rem',
    fontWeight: 'bold',
    fontSize: 16
  },

  operator: {
    width: '5vw',
    margin: '0.2vw',
    height: '10vh',
    background: '#6D6D7F',
    color: '#fff',
    display: 'flex',
    alignItems: 'center',
    justifyContent: 'center',
    textAlign: 'center',
    borderRadius: '0.5rem',
    fontWeight: 'bold',
    fontSize: 16
  }
};

export default Button;
